(1, '2004-04-11 16:38:00', '0000-00-00 00:00:00', 'textpattern', '2004-09-11 10:49:04', 'mearso', 'About My Work', '', 'The Images of childhood form my visual language, a style developed during the final months at art college in Dundee, Scotland. However, it was only after graduating and creating a whole body of work from those initial pieces that I realised there was something more going on than a simple portrayal of my ''happy'' childhood. New pieces brought increasingly uneasy responses from others and it soon became obvious that the work had a dark and maybe macabre underlying nature.\r\n\r\nIt seems that unconsciously remembered injustices left to fester had begun to find their adult voice. This visual language has never spoken directly about the childhood injustices however and still skirts around the real chosen issues - riding with them on the back of other, grown-up experienced injustices and emotional hurts.\r\n\r\nThat initial need to heal my childhood hurt has now combined with a strong desire to communicate with the ''hidden'' pains of others, to depict encountered injustices and to share personal ideas.\r\n\r\nUsing self-selected, ''familiar'' toys is a natural choice - yielding visions of a much wished for but kinder and ochre-tinted memory of childhood. Invariably, however, by the time a piece has been created, the chosen toys are maimed, cracked and sinister - harmed by a physical version of the psychological pain that remains from rejection in childhood.\r\n\r\nThis doesn''t mean the work produced is dark and ugly and that the doom and gloom of a therapy-based aspect is the only spur to work - the big prize lies in the tussle when creating a piece of work: the chase of orchestrating play of line and form, the breathtaking buzz of getting ''hot'' when brain, eye, hand and heart come together so honestly - it is uniquely sweet, joyful and totally addictive as a practice.', '	<p>The Images of childhood form my visual language, a style developed during the final months at art college in Dundee, Scotland. However, it was only after graduating and creating a whole body of work from those initial pieces that I realised there was something more going on than a simple portrayal of my &#8216;happy&#8217; childhood. New pieces brought increasingly uneasy responses from others and it soon became obvious that the work had a dark and maybe macabre underlying nature.</p>\n\n	<p>It seems that unconsciously remembered injustices left to fester had begun to find their adult voice. This visual language has never spoken directly about the childhood injustices however and still skirts around the real chosen issues &#8211; riding with them on the back of other, grown-up experienced injustices and emotional hurts.</p>\n\n	<p>That initial need to heal my childhood hurt has now combined with a strong desire to communicate with the &#8216;hidden&#8217; pains of others, to depict encountered injustices and to share personal ideas.</p>\n\n	<p>Using self-selected, &#8216;familiar&#8217; toys is a natural choice &#8211; yielding visions of a much wished for but kinder and ochre-tinted memory of childhood. Invariably, however, by the time a piece has been created, the chosen toys are maimed, cracked and sinister &#8211; harmed by a physical version of the psychological pain that remains from rejection in childhood.</p>\n\n	<p>This doesn&#8217;t mean the work produced is dark and ugly and that the doom and gloom of a therapy-based aspect is the only spur to work &#8211; the big prize lies in the tussle when creating a piece of work: the chase of orchestrating play of line and form, the breathtaking buzz of getting &#8216;hot&#8217; when brain, eye, hand and heart come together so honestly &#8211; it is uniquely sweet, joyful and totally addictive as a practice.</p>\n\n\n ', '', '\n\n\n ', '', '', '', 0, '', 0, 4, 1, 1, 'about', '', '', 'about-my-work', '', '', '', '', '', '', '', '', '', '', 'dd06ecca783d3462bb2d77ccabe9b7a8', '2004-04-11'),
