(29, '2005-02-02 17:09:00', '0000-00-00 00:00:00', 'mearso', '2006-09-30 20:34:03', 'mearso', 'Other Projects', '', 'February 1992 \r\nInset day instruct Cardiff teachers from Eglwys Newydd and Coryton Primary Schools - Silkscreen monoprinting.\r\n\r\nMarch 1992\r\nHalf inset day instruct teachers Treorchy Comprehensive, Rhondda.\r\n\r\nDecember 1996\r\nBanner-making Project \r\n\r\nAugust 1995\r\nYouth Cafe, Tredegar. Create 3 x 9ft banners for bandstand to be displayed during the summer festival.Also work with children/youths within cafe to produce art works for walls and cards to take-away.Set of screen equipment left with cafe so work can continue after project finished. ', '	<p>February 1992 <br />\nInset day instruct Cardiff teachers from Eglwys Newydd and Coryton Primary Schools &#8211; Silkscreen monoprinting.</p>\n	<p>March 1992<br />\nHalf inset day instruct teachers Treorchy Comprehensive, Rhondda.</p>\n	<p>December 1996<br />\nBanner-making Project </p>\n	<p>August 1995<br />\nYouth Cafe, Tredegar. Create 3&#215;9ft banners for bandstand to be displayed during the summer festival.Also work with children/youths within cafe to produce art works for walls and cards to take-away.Set of screen equipment left with cafe so work can continue after project finished. </p>\n\n ', '', '\n\n ', '', 'Projects', '', 0, '', 0, 4, 1, 1, 'cv', '', '', 'projects', '', '', '', '', '', '', '', '', '', '', '10469364706c85e51c4d1e7e3b4a6cc3', '2005-02-02'),
(30, '2005-02-02 17:11:00', '0000-00-00 00:00:00', 'mearso', '2006-09-30 20:22:14', 'mearso', 'Lecturing', '', '1988 - 1992 Part-time printmaking lecturer/departmental head cover, Printmaking Gwent College of Art, Clarence Place,Newport.Working with practically all departments at all year levels.\r\n\r\nMarch 1992 Visiting lecturer (illustration), West Glamorgan Institute, Mount Pleasant, Swansea. \r\n\r\nSeptember 1992 - June 1993 Part-time lecturer (illustration), West Glamorgan Institute,Mount Pleasant, Swansea.\r\n\r\nDecember 1994 Visiting Lecturer (BA) West Glamorgan Institute, Town Hill Campus, Swansea.\r\n\r\nOctober 1996 -June 1998 Part-time lecturer (BA) Illustration, Swansea Institute, Town Hill.  ', '	<p>1988 &#8211; 1992 Part-time printmaking lecturer/departmental head cover, Printmaking Gwent College of Art, Clarence Place,Newport.Working with practically all departments at all year levels.</p>\n	<p>March 1992 Visiting lecturer (illustration), West Glamorgan Institute, Mount Pleasant, Swansea. </p>\n	<p>September 1992 &#8211; June 1993 Part-time lecturer (illustration), West Glamorgan Institute,Mount Pleasant, Swansea.</p>\n	<p>December 1994 Visiting Lecturer (BA) West Glamorgan Institute, Town Hill Campus, Swansea.</p>\n	<p>October 1996 -June 1998 Part-time lecturer (BA) Illustration, Swansea Institute, Town Hill.  </p>\n\n ', '', '\n\n ', '', 'Lecturing', '', 0, '', 0, 4, 1, 1, 'cv', '', '', 'lecturing', '', '', '', '', '', '', '', '', '', '', '78b688d7519a2a8368561d49be1c5c17', '2005-02-02'),
(31, '2005-02-02 17:13:00', '0000-00-00 00:00:00', 'mearso', '2006-09-30 20:11:52', 'mearso', 'Placements &#38; residencies', '', 'Printmaking Residency\r\n\r\nAwarded Competitive Scholarship to work as artist in residence at Ysgol Uwchradd Bodedern, Anglesey. September - November 1986.Exhibited: November 86 Ysgol Uwchradd Bodedern (NWAAAssisted); June 87 County Council Headquarters Caernarfon; July 87 Theatre Gwynedd, Bangor \r\n\r\nPainter/Printmaker Placement\r\n\r\n10-Day South West Arts Placement at Avishayes County Primary School,Chard, Somerset.(silkscreen monoprinting within special care/needs facility also).June 1987.\r\n\r\nPainter/Printmaker Residency Artist in Residence at Durham Road Junior School, Newport, Gwent.\r\n\r\nSet up studio/etching and silkscreen facility. Worked with whole school using both techniques. Worked with writers and poets in residence to create illustrated pieces. Gave slide talks and entered children''s work in Cadbury''s art competition with resultant winners. 22 weeks from Sept''87 - March''88. Exhibited works at Llantarnum Grange Arts Centre, Cwmbran in March''88 and in the Gwent Artists in Residence exhibition, Llantarnum Grange Arts Centre in May 1988.\r\n\r\nPrintmaker Placement\r\n\r\n3-Day S.E.W.A.A. assisted to instigate/install silkscreen facility in Gwernllwyn Junior School, Merthyr Tydfil. September 1990. \r\n\r\nPrintmaker Placement\r\n\r\n3-Day to instigate/install silkscreen facility in Penguelan Primary School, Mountain Ash, Mid Glamorgan. May 1991.\r\n\r\nArtist in Residence Philadelphia USA\r\n\r\nArtist in residence/faculty member at Pennsylvania Academy of Fine Art, Philadelphia,U.S.A.. January ''93 to March 1993. Exhibition: end of residency show within Pennsylvania Academy of Fine Art. \r\n\r\nArtist Placement October 1994.\r\n\r\nArtist working (through Hafod Housing) within 3 institutions for the elderly around Cardiff. 10 weeks duration from October to Christmas. Print and collage mediums, create large wall board and individual art works and cards. Art works entered into the Elderly Action Council Art Comp.and residents from two sites had work short listed. Chosen pieces were framed and exhibited in London exhibition. Working on in sites to continue weekly visits after placement has ended. Working in new site also. (Resultant resident''s artwork framed and toured - Arts Council of Wales and Hafod Housing Association assisted).\r\n\r\nDesign Collaboration for Performance September 1994. Pramen festival, Cross keys, Gwent.\r\n\r\nWorked with Blackwood Miners Institute and choreographers to create 18FT painted dragon spread over 30 hand-held boards with letterforms on the back, flags for dancers and triptych for backdrops.', '	<p>Printmaking Residency</p>\n	<p>Awarded Competitive Scholarship to work as artist in residence at Ysgol Uwchradd Bodedern, Anglesey. September &#8211; November 1986.Exhibited: November 86 Ysgol Uwchradd Bodedern (NWAAAssisted); June 87 County Council Headquarters Caernarfon; July 87 Theatre Gwynedd, Bangor </p>\n	<p>Painter/Printmaker Placement</p>\n	<p>10-Day South West Arts Placement at Avishayes County Primary School,Chard, Somerset.(silkscreen monoprinting within special care/needs facility also).June 1987.</p>\n	<p>Painter/Printmaker Residency Artist in Residence at Durham Road Junior School, Newport, Gwent.</p>\n	<p>Set up studio/etching and silkscreen facility. Worked with whole school using both techniques. Worked with writers and poets in residence to create illustrated pieces. Gave slide talks and entered children&#8217;s work in Cadbury&#8217;s art competition with resultant winners. 22 weeks from Sept&#8217;87 &#8211; March&#8217;88. Exhibited works at Llantarnum Grange Arts Centre, Cwmbran in March&#8217;88 and in the Gwent Artists in Residence exhibition, Llantarnum Grange Arts Centre in May 1988.</p>\n	<p>Printmaker Placement</p>\n	<p>3-Day S.E.W.A.A. assisted to instigate/install silkscreen facility in Gwernllwyn Junior School, Merthyr Tydfil. September 1990. </p>\n	<p>Printmaker Placement</p>\n	<p>3-Day to instigate/install silkscreen facility in Penguelan Primary School, Mountain Ash, Mid Glamorgan. May 1991.</p>\n	<p>Artist in Residence Philadelphia USA</p>\n	<p>Artist in residence/faculty member at Pennsylvania Academy of Fine Art, Philadelphia,U.S.A.. January &#8216;93 to March 1993. Exhibition: end of residency show within Pennsylvania Academy of Fine Art. </p>\n	<p>Artist Placement October 1994.</p>\n	<p>Artist working (through Hafod Housing) within 3 institutions for the elderly around Cardiff. 10 weeks duration from October to Christmas. Print and collage mediums, create large wall board and individual art works and cards. Art works entered into the Elderly Action Council Art Comp.and residents from two sites had work short listed. Chosen pieces were framed and exhibited in London exhibition. Working on in sites to continue weekly visits after placement has ended. Working in new site also. (Resultant resident&#8217;s artwork framed and toured &#8211; Arts Council of Wales and Hafod Housing Association assisted).</p>\n	<p>Design Collaboration for Performance September 1994. Pramen festival, Cross keys, Gwent.</p>\n	<p>Worked with Blackwood Miners Institute and choreographers to create 18FT painted dragon spread over 30 hand-held boards with letterforms on the back, flags for dancers and triptych for backdrops.</p>\n\n ', '', '\n\n ', '', 'Placements & Residencies', '', 0, '', 0, 4, 1, 1, 'cv', '', '', 'placements-residencies', '', '', '', '', '', '', '', '', '', '', 'dcb5bc4e5642d0fc0987ae8451c37ccd', '2005-02-02');
