(88, '2006-09-30 20:31:02', '0000-00-00 00:00:00', 'mearso', '2006-09-30 20:31:02', '', 'Tree Dressing Project', '', 'Working with 2 schools (Fynnon Taf Primary and Nantgarw Infants) to produce a variety of lanterns, banners and other decorative items which celebrated (and hung from) the tree. Large kappa leaves with children''s poems about particular trees on, twig people made by the children and parents, wildlife lanterns painted and decorated by the children, laminated working drawings of creatures, leaves and hand prints, etc. Work done in conjunction with visiting storyteller and culminated in actual dressing ceremony led by banners, storyteller and musician. ', '	<p>Working with 2 schools (Fynnon Taf Primary and Nantgarw Infants) to produce a variety of lanterns, banners and other decorative items which celebrated (and hung from) the tree. Large kappa leaves with children&#8217;s poems about particular trees on, twig people made by the children and parents, wildlife lanterns painted and decorated by the children, laminated working drawings of creatures, leaves and hand prints, etc. Work done in conjunction with visiting storyteller and culminated in actual dressing ceremony led by banners, storyteller and musician. </p>\n\n ', '', '\n\n ', '', 'Projects', '', 0, '', 0, 4, 1, 1, 'cv', '', '', 'tree-dressing-project', '', '', '', '', '', '', '', '', '', '', 'aab102218cf92c080f333654bf23ea56', '2006-09-30'),
