(17, 'www.livejournal.com/users/casual_frown/friends?skip=5', 'barely alive', 1, 'In my desperation to use the internet for reasons other than stalking people (you know you do it too), I''ve stumbled upon some sweet websites and now I will share them:Bearskinrug.  This guy''s sketchbook is amazing and he''s got quite an eye for talent, because a lot of the sites I''m listing I found in his link section.Scott G. Brooks Gallery.  It''s not that I don''t like painting as a medium, I just typically find myself unimpressed by most paintings that I see, but I love this guy''s work.  His subject matter is creepy and insane,  yes, but it''s striking nonetheless.Mel Kadel.  I''m in love with his drawings (ie. Swingset girls)  and the way he uses old book covers is fantastic (ie. bumper car bullies). Gary Baseman.  Sighhh, I met this guy in all of his purple-suited glory at his gallery opening in Rome.  Good times, and GOOD work, it''s totally nuts.Diane Murphy.  Some nice etchings and prints of various sorts.  I especially like this one and this one.  (PS - the title on this one is "Just Stay Young and Beautiful" but the pencilled in title under the print is "Just Stay Yound, Dumb, and Beautiful" which I think is much better, haha.)'),
